$(document).keydown(function(event){
    if(event.which=="17")
      cntrlIsPressed = true;
    if(event.which=="16"){
    	shiftIsPressed = true;
    }
    	
});

$(document).keyup(function(event){
	if(event.which=="17")
    cntrlIsPressed = false;
  if(event.which=="16"){
  	shiftIsPressed = false;
  	clicked = false;
  	rightClicked = false;
  }
});

var cntrlIsPressed = false;
var shiftIsPressed = false;
var clicked = false;
var rightClicked = false;

function ToReactors(){
	$('.reactors').show();
	$('#gameOverlayTable').hide();
}

function ShowMap(map){
	$('.reactors').hide();
	$('#gameOverlayTable').show();
	$('.reactor').html(BuildMap(map));
	AddClickEvents();
	AddMouseOver();
}
function SellAll(component){
	var cell = $('.reactorTable').find('div');
	while (cell != null){
		var child = cell.find('div');
		if (child.hasClass(component)){
			child.remove();
		}
		cell = cell.nextSibling();
	}
	
}

function AddMouseOver(){
	$('.tile').mouseover(function(){
		if (shiftIsPressed){
			if (clicked){
				if ($(this).parent().hasClass('buildable')){
					var id = $('.componentButtonSelected').attr('data-id');
					var x = $(this).attr('data-x');
					var y = $(this).attr('data-y');
					CellClick(id,x,y,$(this));
				}
			}else if (rightClicked){
				var node = $(this).find('div');
				node.remove();
			}
		}
	});
}

function AddClickEvents(){
	$('.tile').mousedown(function(e){
		if (e.which == 3){
			if (shiftIsPressed){
				rightClicked = true;
			}
			var node = $(this).find('div');
			if (cntrlIsPressed){
				node.removeClass('component');
				SellAll(node.attr('class'));
				alert('with CTRL');
			}else{
				node.remove();
			}
		}else{
			if (shiftIsPressed){
				clicked = true;
			}
			if ($(this).parent().hasClass('buildable')){
				var id = $('.componentButtonSelected').attr('data-id');
				var x = $(this).attr('data-x');
				var y = $(this).attr('data-y');
				CellClick(id,x,y,$(this));
			}
		}
	});
}

function CellClick(dataId,dataX,dataY,sender){
	var div = document.createElement('div');
	div.className = 'component ' + dataId;
	div.setAttribute('data-x', dataX);
	div.setAttribute('data-y', dataY);
	div.setAttribute('opacity', '1');
	div.setAttribute('style', 'cursor: pointer; opacity: 1;');
	sender.append(div);
}

function BuildMap(map){
	if (map == 1){
		return BuildIsland();
	}
	if (map == 2){
		return BuildVillage();
	}
	if (map == 3){
		return BuildRegion();
	}
	if (map == 4){
		return BuildCity();
	}
	if (map == 5){
		return BuildSHC();
	}
	if (map == 6){
		return BuildMetropolis();
	}
	if (map == 7){
		return BuildMainland();
	}
	if (map == 8){
		return BuildContinent();
	}
	return "";

}

